                "BUILD.bazel": "###############################################################################\n# @generated\n# DO NOT MODIFY: This file is auto-generated by a crate_universe tool. To \n# regenerate this file, run the following:\n#\n#     bazel mod show_repo 'gazelle_rust'\n###############################################################################\n\npackage(default_visibility = [\"//visibility:public\"])\n\nexports_files(\n    [\n        \"cargo-bazel.json\",\n        \"crates.bzl\",\n        \"defs.bzl\",\n    ] + glob(\n        allow_empty = True,\n        include = [\"*.bazel\"],\n    ),\n)\n\nfilegroup(\n    name = \"srcs\",\n    srcs = glob(\n        allow_empty = True,\n        include = [\n            \"*.bazel\",\n            \"*.bzl\",\n        ],\n    ),\n)\n\n# Workspace Member Dependencies\nalias(\n    name = \"cargo-lock-11.0.0\",\n    actual = \"@crates__cargo-lock-11.0.0//:cargo_lock\",\n    tags = [\"manual\"],\n)\n\nalias(\n    name = \"cargo-lock\",\n    actual = \"@crates__cargo-lock-11.0.0//:cargo_lock\",\n    tags = [\"manual\"],\n)\n\nalias(\n    name = \"cargo_toml-0.22.3\",\n    actual = \"@crates__cargo_toml-0.22.3//:cargo_toml\",\n    tags = [\"manual\"],\n)\n\nalias(\n    name = \"cargo_toml\",\n    actual = \"@crates__cargo_toml-0.22.3//:cargo_toml\",\n    tags = [\"manual\"],\n)\n\nalias(\n    name = \"clap-4.5.53\",\n    actual = \"@crates__clap-4.5.53//:clap\",\n    tags = [\"manual\"],\n)\n\nalias(\n    name = \"clap\",\n    actual = \"@crates__clap-4.5.53//:clap\",\n    tags = [\"manual\"],\n)\n\nalias(\n    name = \"lazy_static-1.5.0\",\n    actual = \"@crates__lazy_static-1.5.0//:lazy_static\",\n    tags = [\"manual\"],\n)\n\nalias(\n    name = \"lazy_static\",\n    actual = \"@crates__lazy_static-1.5.0//:lazy_static\",\n    tags = [\"manual\"],\n)\n\nalias(\n    name = \"syn-2.0.111\",\n    actual = \"@crates__syn-2.0.111//:syn\",\n    tags = [\"manual\"],\n)\n\nalias(\n    name = \"syn\",\n    actual = \"@c